(2,201,'terms-and-conditions',30,'','','Terms and Conditions','Terms of Use','','','<p>Ketentuan Kerahasiaan atau Kebijakan Privasi (&ldquo;Ketentuan Kerahasiaan&rdquo;) berikut menguraikan bagaimana kami mengumpulkan, menggunakan, menyingkapkan serta memproses informasi yang dapat diidentifikasi secara pribadi yang kami kumpulkan tentang individu (Data Pribadi) terkait dengan layanan yang tersedia dari Opsigo melalui Situs web yang beralamatkan di book.opsigo.id</p>\r\n\r\n<p>Dengan mengunjungi Situs, Anda menyetujui pengumpulan, penggunaan, penyingkapan dan pemrosesan Data Pribadi Anda sebagaimana diuraikan dalam Ketentuan Kerahasiaan ini. Semua data yang kami kumpul dan proses disimpan pada server yang berada di Indonesia.</p>','','',1,0,0,1,'2017-02-05 01:06:47',1,'2018-06-07 14:01:40','172.20.0.1',0,0,1,'footer',NULL),
(3,654,'corporate-travel-management',0,'','','Corporate Travel Management','Corporate Travel','Booking travel is easy now. Why you need a Corporate Travel Management Company?','282header-corporate.jpg','<p style=\"text-align:justify\">Asking your own highly skilled employees to book travel arrangements is certainly not an option for your business, and it means loss in your productivity. How many unproductive hours of searching the internet are you and your staff spending to get your travel arrangements? If you are a small or large multi-million dollar business and you value time, experience, service, and money, using a Travel Management Company is certainly the right choice for you.</p>\r\n\r\n<p style=\"text-align:justify\">A Travel Management Company (TMC) is much more than a simple travel agent. Travel expenditures are typically the second largest controllable expense of corporations, often higher than IT or R&amp;D spend. As a result, the travel procurement process is critical, beyond the act of travel reservation itself. Your travel partner needs to bring you solutions to implement your policy and processes, provide you access to the right fares, meaning the lowest fares that meet your specific needs which vary from business to business and even from trip to trip, be able to give you travel advice on how to get there, offer you cost-effective hotel options, and then when the transaction is done, provide the company with accurate Management Information on where its money went, as well as being able to provide emergency assistance when the situation calls for it. All this needs to happen quickly, efficiently, consistently, and in a customer-friendly manner.</p>\r\n\r\n<p style=\"text-align:justify\">Doing all this is a challenge that many fail to meet with consistency. That is why Opsigo Corporate Travel (PT Opsigo) is widely recognized at the most respected TMC in Indonesia: we are the experts of Corporate Travel Management, and we do it best.</p>','','',1,0,1,1,'2017-02-20 22:55:56',1,'2018-10-31 15:55:39','172.20.0.1',0,0,1,'nav',NULL),
(4,833,'travel-management-service',28,'','','Travel Management Service','Travel Service','Travel Management Service','270travel_hero.jpg','<p>One of our core values is Customer First, and we apply this in how we design the right service configuration for your business. We will discuss your needs in detail, give you options and assist you in choosing the option that is right for you. As Opsigo&rsquo;s partners, you will be eligible to get a wide-range of corporate travel services:</p>','[{\"title_list\":\"Airline Tickets\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;Whilst flying seems simpler today than ever before, booking and issuing tickets require ever more technology and know-how by the agents, as content is increasingly fragmented across multiple sources. In that sense, with a large domestic airline industry sitting outside the traditional GDS systems (Global Distribution Systems), Indonesia is one of the most challenging environments to perform a consistent travel service.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Our systems include solutions that were developed specifically for Opsigo in partnership with third party providers. They allow us to handle this complexity and capture all the data that is critical to your Management Information, whether International flights or Domestic flights.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Our expert ticketing staff will provide your travelers and travel bookers with all the information they need to know to choose the right flight that meets their schedule and budget needs.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;We will also work with you to make available to your company the corporate fares that airlines provides top agents, saving you from the hassle of renewing annual procurement contracts with all airlines.&lt;\\/p&gt;\\r\\n\",\"img\":\"\"},{\"title_list\":\"Hotel Vouchers\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;More and more companies rely on their Travel Management provider nowadays to offer competitive hotel content to their travelers, providing them the advice they need for their hotel needs and the convenience of holding discounted hotel vouchers before they fly.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Opsigo &amp;nbsp;is a prominent hotel buyer in Indonesia and therefore offers attractive discounts to over 500 hotels across the country. In addition, Opsigo launched in April 2013 an in-house online hotel portal linked to several strategically selected global consolidators via an XML connection, giving our travel consultants real-time access to over 100,000 properties worldwide at discounted rates.&lt;\\/p&gt;\\r\\n\",\"img\":\"\"}]','',1,0,0,1,'2017-02-21 00:26:25',1,'2017-09-16 04:24:26','172.20.0.1',0,0,1,'footer',NULL),
(5,949,'company-opsigo',28,'','','Company Opsigo','Reka Sinergi Pratama','Company Opsigo Booking','323Tulips.jpg','<p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 ib va_middle\">Our partnership with Hogg Robinson Group (HRG) since 1995 has enhanced our capability in handling multinational accounts, from our account management approach to online technologies, to 24/7 service year-round.</p>\r\n                          \r\n                                          \r\n                                                               <p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 mt_30\">The trust that HRG has kept in Opsigo Corporate Travel (PT Vayatour) over nearly two decades is another proof of the highest level of standards that we uphold in how we design and deliver travel management services.</p>\r\n\r\n<p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 mt_30\">Hogg Robinson Group (HRG) is an award-winning international corporate services company specializing in travel, expense and data management, underpinned by proprietary technology.</p>\r\n\r\n<p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 mt_30\">We are a company that delivers above and beyond the call of duty for all our stakeholders. We take pride in working harder and going further to support our clients to achieve their commercial objectives. To do this, we provide a range of products and services which we tailor to fit their needs.</p>\r\n\r\n<p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 mt_30\">With a global team of more than 12,000 people, we operate in over 120 countries. We take great pride in our heritage: from the origins of our business in 1845, through the opening of our first travel office in 1945, and to the worldwide network you see today.</p>\r\n\r\n<p class=\"avenir_regular fs_16 lh_25 color_dark_gray_2 mt_30\">Visit www.hrgworldwide.com for more information about HRG, Opsigo Corporate Travel&rsquo;s global travel partner.</p>\r\n','[{\"title_list\":\"First Content\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;Our partnership with Hogg Robinson Group (HRG) since 1995 has enhanced our capability in handling multinational accounts, from our account management approach to online technologies, to 24\\/7 service year-round.&lt;\\/p&gt;\\r\\n\",\"img\":\"964Desert.jpg\"},{\"title_list\":\"Second Content\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;The trust that HRG has kept in Opsigo Corporate Travel (PT Vayatour) over nearly two decades is another proof of the highest level of standards that we uphold in how we design and deliver travel management services.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Hogg Robinson Group (HRG) is an award-winning international corporate services company specializing in travel, expense and data management, underpinned by proprietary technology.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;We are a company that delivers above and beyond the call of duty for all our stakeholders. We take pride in working harder and going further to support our clients to achieve their commercial objectives. To do this, we provide a range of products and services which we tailor to fit their needs.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;With a global team of more than 12,000 people, we operate in over 120 countries. We take great pride in our heritage: from the origins of our business in 1845, through the opening of our first travel office in 1945, and to the worldwide network you see today.&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Visit www.hrgworldwide.com for more information about HRG, Opsigo Corporate Travel&amp;rsquo;s global travel partner.&lt;\\/p&gt;\\r\\n\",\"img\":\"\"}]','',1,0,0,1,'2017-02-21 00:52:26',1,'2017-10-10 11:28:24','172.24.0.1',0,0,1,'footer',NULL),
(6,656,'why-opsigo-corporate-travel',0,'','','Why Opsigo Corporate Travel','Why Opsigo Corporate Travel','Why Opsigo Corporate Travel','349why_hero.png','<p><span style=\"font-family:avenirnextregular; font-size:16px\">There are objective reasons why Opsigo Corporate Travel (PT Opsigo) is the most chosen corporate travel provider in Indonesia. Our six core differentiators:</span></p>','[{\"title_list\":\"A True Business Partner\",\"list\":\"Flexible service set-up \r&lt;br&gt;Real account management \r&lt;br&gt;Data you can rely upon\",\"img\":\"665icon_partner.png\"},{\"title_list\":\"Smarter Technology\",\"list\":\"Non GDS agregation for air and hotel \r&lt;br&gt;Contact center technology\",\"img\":\"717icon_laptop.png\"},{\"title_list\":\"Backed By CT Corp\",\"list\":\"Financially sound \r&lt;br&gt;Cross benefit (corporate card, meeting facilities) \r&lt;br&gt;Data you can rely upon\",\"img\":\"024icon_buildings.png\"},{\"title_list\":\"Always Reliable Price\",\"list\":\"Competitive \r&lt;br&gt;Trustworthy \r&lt;br&gt;Industry #fares and rates\",\"img\":\"789icon_money.png\"},{\"title_list\":\"The VayaTour Technology\",\"list\":\"Recognized expert people Client first u201ccultureu201d 24 / 7 Service center\",\"img\":\"358icon_cust_service.png\"},{\"title_list\":\"Part of Antavaya\",\"list\":\"Leisure offering Inceptive trips Meeting and events\",\"img\":\"804icon_legion.png\"}]','',1,0,2,1,'2017-02-21 01:23:35',1,'2017-02-21 03:51:35','119.81.65.147',0,0,1,'footer',NULL),
(8,68,'conference-exhibition',0,'','','Conference & Exhibition','Conferences & Exhibition','The Professional Conference & Exhibition Organizer','840exhibition_hero.jpg','<p>The Opsigo Convex team is made of seasoned professionals with a long experience in creating, organizing, selling and delivering successful conferences and exhibitions in the Business-to-Business sector (B2B) as well as Business-to-Government (B2G) and Government-to-Government (G2G).</p>\r\n\r\n<p>Our Mission is to create the leading Business Conference and Exhibition Organizer (PCEO) in Indonesia, addressing business-critical issues in key industries for our nation and the Asia Pacific region as a whole, and to deliver tangible business results for the trade associations, government institutions, private corporations and individual professionals involved in our events.</p>\r\n\r\n<p>Our values are reliability, creativity, business relevancy, and genuine care for our guests, hosts, delegates, exhibitors and staff.</p>\r\n\r\n<p>For more information on our Conference and Exhibition services and upcoming events, visit our dedicated website at&nbsp;<a href=\"http://www.opsigo.com/\" style=\"box-sizing: border-box; background-color: transparent; color: inherit; text-decoration: none;\" target=\"_blank\">www.opsigo.com</a></p>','','',1,0,1,1,'2017-02-21 02:20:36',1,'2018-10-31 15:55:32','172.24.0.1',0,0,1,'nav',NULL),
(9,632,'why-join-us',0,'','','Why Join Us','Why Join Us','Why Join Us','039why_join_us_img.jpg','<p>Opsigo Group offers unparalleled career opportunities for travel professionals at any stage of their career. We are the largest travel company in Indonesia, with the broadest network, and an ambitious expansion plan to grow our business and launch new businesses. This will provide you with infinite opportunities to develop your skills, broaden your horizons and gain seniority.</p>\r\n\r\n<p>Whether you are a young travel-trained graduate looking to enter the industry or a seasoned travel professional looking for an ambitious, modern-thinking environment to grow and develop, contact us today to discover each other better.</p>','','',1,0,1,1,'2017-02-21 02:53:21',1,'2018-10-31 16:02:54','119.81.65.147',0,0,1,'navmore2',NULL),
(10,875,'inbound-service',0,'','','Inbound Service','Inbound Service','Inbound Service','727exhibition_hero.jpg','<p>For decades, Opsigo has been the preferred Destination Management Company (DMC) in Indonesia for many tour operators around the world. Previously done under the brand of Vayatour, our inbound services are now recognized as Opsigo Destination. We receive international tourists from all origins, from FIT honeymooners to recurring tour series, always ensuring a smooth and memorable journey. We partner with local tour guides of multiple language abilities, who understand their local area better than anyone.</p>\r\n\r\n<p>Opsigo Destination is headquarters in Bali, where the heart of inbound tourism lies today, but thanks to our national network we are one of the premier inbound operators outside of Bali, from the great Java-to-Bali overland adventure to the muslim-favorite Jakarta-Puncak-Bandung route, and on to virtually all islands in the Indonesian archipelago.</p>','[{\"title_list\":\"Our DMC services include\",\"subtitle_list\":\"\",\"list\":\"&lt;h3&gt;Custom quote for any size&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Itinerary and routing advisory&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Hotel sourcing&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Transfer, transportation&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Tour guide&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Side trips, extension trips&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Inbound MICE services&lt;\\/h3&gt;\\r\\n\\r\\n&lt;h3&gt;Custom request services&lt;\\/h3&gt;\\r\\n\",\"img\":\"\"}]','',1,0,1,1,'2017-02-21 03:06:17',1,'2018-10-31 15:55:50','172.20.0.1',0,0,1,'navmore1',NULL),
(11,933,'why-we-are',0,'','','Why Opsigo Corporate Travel','Why We Are','Why Opsigo Corporate Travel','447why_hero.png','<p>There are objective reasons why Opsigo Corporate Travel (PT Opsigo) is the most chosen corporate travel provider in Indonesia. Our six core differentiators:</p>','[{\"title_list\":\"A True Business Partner\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;Flexible service set-up&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Real account management&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Data you can rely upon&lt;\\/p&gt;\\r\\n\",\"img\":\"445icon_partner.png\"},{\"title_list\":\"Always Reliable Price\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;Competitive&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Trustworthy&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Industry #fares and rates&lt;\\/p&gt;\\r\\n\",\"img\":\"050icon_money.png\"},{\"title_list\":\"Smarter Technology\",\"subtitle_list\":\"\",\"list\":\"&lt;p&gt;Non GDS agregation for air and hotel&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;Contact center technology&lt;\\/p&gt;\\r\\n\",\"img\":\"459icon_laptop.png\"}]','',1,0,1,1,'2017-02-21 04:00:48',1,'2018-10-31 16:02:02','172.20.0.1',0,0,1,'navmore1',NULL),
(16,519,'who-we-are',28,'','','Who We Are','About','About Us','5bd9be18859bc.jpg','<p>Opsigo Corporate Travel (PT Opsigo) is the leading travel management company in Indonesia, helping corporations of all sizes, multinationals and government institutions manage travel in a professional and cost effective way.</p>\r\n\r\n<p>Opsigo Corporate Travel is the corporate travel arm of Opsigo Group, Indonesia&rsquo;s largest travel company whose other interests include leisure travel and tours, meetings &amp; events, incentive travel, inbound travel and hotel distribution. Since 2007 Opsigo has been a business of CT Corp, one of the fastest-growing business groups in Indonesia under the leadership of chairman Chairul Tanjung. This provides Opsigo with unique synergies with other CT Corp businesses in the finance, hospitality, media, entertainment and retail space.</p>\r\n\r\n<p>Opsigo Corporate Travel is the largest Travel Management Company in Indonesia. Established in 1965, it has gained a reputation of service quality and professional management second to none. With more than 600 stafffocused exclusively on corporate travel, a three-floor contact centre with advanced telephony and systems, over 40 implant locations, and a national network spanning Java, Sulawesi, Balikpapan, Bali, Makassar, all the way to Papua, AntaVaya Corporate Travel is in a unique position to deliver the specific travel service that your company needs.</p>\r\n\r\n<p>In 1994 PT Opsigo (Opsigo Corporate travel legal entity) joined forces with Opsigo Tour, another established travel brand, to form Opsigo, the leading travel agency in the country. In 2012, Opsigo started to regroup all corporate travel activities under the Opsigo Corporate Travel banner, so today it has an exclusive focus on corporate services. That single focus is another strength to maintain our corporate leadership.</p>','[{\"title_list\":\"BAGUS PRIATNA\",\"subtitle_list\":\"Executive Director - Corporate Services\",\"list\":\"&lt;p&gt;Progressing experience in Corporate Travel Business over 10 years, including roles at leading Travel Management Companies. Bagus leads Corporate business with a strong focus on acquisition, business development, account management and business operations.&lt;\\/p&gt;\\r\\n\",\"img\":\"087team_image1.jpg\"},{\"title_list\":\"MELI SYAFEI\",\"subtitle_list\":\"Business Head - Corporate Travel\",\"list\":\"&lt;p&gt;A corporate travel business focus individual, who has extensive experience &amp;amp; role within the travel industry over 10 years including role at American Express. She looks after national accounts, global accounts as well as developing public sectors.&lt;\\/p&gt;\\r\\n\",\"img\":\"029team_image2.jpg\"}]','',0,0,0,1,'2017-02-22 08:34:49',1,'2018-10-31 20:12:13','172.20.0.1',0,0,1,'footer',NULL),
(18,301,'privacy-policy',30,'','','Privacy Policy','Privacy Policy','','','<p>Ketentuan Kerahasiaan atau Kebijakan Privasi (&ldquo;Ketentuan Kerahasiaan&rdquo;) berikut menguraikan bagaimana kami mengumpulkan, menggunakan, menyingkapkan serta memproses informasi yang dapat diidentifikasi secara pribadi yang kami kumpulkan tentang individu (&ldquo;Data Pribadi&rdquo;) terkait dengan layanan yang tersedia dari Opsigo melalui Situs web yang beralamatkan di book.opsigo.id</p>\r\n\r\n<p>Dengan mengunjungi Situs, Anda menyetujui pengumpulan, penggunaan, penyingkapan dan pemrosesan Data Pribadi Anda sebagaimana diuraikan dalam Ketentuan Kerahasiaan ini. Semua data yang kami kumpul dan proses disimpan pada server yang berada di Indonesia.</p>','','',1,0,0,1,'2017-02-05 01:06:47',1,'2017-04-03 08:42:13','120.188.77.158',0,0,1,'footer',NULL),
