(21,177,'tour-leisure',0,'','','Tour & Leisure','Tour & Leisure','Booking  travel is easy now. Why you need a Tour?','019Desert.jpg','<p><span style=\"font-family:montserrat; font-size:14px\">Dapatkan tiket Universal Studios Japan&reg; sekarang. Salah satu theme park yang wajib anda kunjungi ketika anda berada di Jepang. Terdapat berbagai atraksi yang akan memberikan anda pengalaman yang menakjubkan. Yang terbaru diantaranya adalah The Wizarding World of Harry Potter&reg;, The Flying Dinosaur, Minion Park&reg;, dan yang terbaru yaitu Super Nintendo World&reg;. Anda benar-benar bisa mengucap dan mengendalikan sihir di dunia Harry Potter, merasakan ketegangan di dunia dinosaurus, bermain dengan para Minions, dan mengunjungi dunia permainan Nintendo&reg;, dan tentunya masih ada puluhan atraksi menarik lainnya. Anda juga bisa mengunjungi toko-toko yang menjual souvenir di dalamnya. Dan jangan lupa bahwa anda juga bisa membeli Universal Express di Tour untuk kemudahan anda mendapatkan prioritas dan menghindari antrian.</span></p>','','',1,0,2,1,'2017-09-16 03:28:17',1,'2018-10-31 15:45:34','172.20.0.1',0,0,1,'footer',NULL),
